import React from 'react'

export default function User() {

    const filed = [
        {
            name: 'Name',
            type: 'text'
        },
        {
            name: 'Email',
            type: 'text'
        }
    ]

  return (
    <div className='w-[30%]'>
     <form>
        <div>
        {
            filed.map((item, index) => {
                return (
                    <div className='flex flex-col gap-2'>
                    <p>{item.name}</p>
                    <input type={item.type} className='border outline-none rounded  p-2' />
                    </div>
                )
            })
        }
        </div>

     </form>
    </div>
  )
}
